import React from "react";

function Ul_li(prop){
    return (
        <li className="bg-dark text-white list-group-item">
        <img style={{width:"10%",marginRight:"20px"}} src={prop.p.img}/>
        <input type="checkbox" id={prop.p.id}></input>
        <label htmlFor={prop.p.htmlFor}>{prop.p.text}</label>
      </li>
        );
}
export default Ul_li;
